insert into comments values (2, 38, 19, '1',
     'Trump''s inept choice of a candidate, based on his capricious and ignorant whims, and ignoring any study about previous records, allows for the humiliation in public of himself and of an inept individual to a job far too big for him (as is the presidency for Trump, by the way), in addition to the abuse of his office, as reported. This is ''planned'' chaos, a product of the stupidity of ''our'' ugly American in-chief. As it will prove to be with Bolton, and as it was with Pruitt and his ilk. This is harmful and aberrant behavior, not the new normal. At least, it shouldn''t.',
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
    'mojodna');
insert into comments values (2, 43, 20, '0',
     'Trump is threatening the Iran deal and Iran directly.<br/>Talk about a man who speaks with a forked tongue.<br/>One minute he wants out of the middle east and the next minute he says that Iran will never restart their nuclear program which means some form of involvement in the middle east.<br/>Never having been a diplomat before you would think that he should look to Europe for guidance but that would mean that he would have to think and that would be a problem.',
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
    'jnewland');
insert into comments values (2, 35, 21, '1',
     '"WASHINGTON ??President Trump on Tuesday decried the nuclear agreement with Iran as a ?쐔errible deal??that failed to restrain threats from Tehran, but said he would use formal meetings with President Emmanuel Macron of France to discuss whether to preserve it."<br/><br/>I hope he has a good French baby sitter.',
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
    'joshknowles');
insert into comments values (2, 49, 22, '0',
     'I''m sure that Trump''s tart "will be the best ever".  As for the "insane, ridiculous" nuclear accord, Trump will undoubtedly trample it as he has done to so many of the accomplishments of the previous administration.  Who knows, perhaps he can have an arm wrestling contest with Macron at dinner  I''m sure he wants to get even for losing the "death grip" with Macron when he visited France.<br/>An aside . . . the Revolutionary War costumes worn by American troops in front of the White House remind me of Nixon''s Secret Service/Palace Guard uniforms.  Both Nixon and Trump aspire(d) to be the Imperial Presidencies.  Let''s hope that the similarities extend to other things as well . . .',
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
    'caged');
insert into comments values (2, 31, 23, '1',
     'He needs a war?봳o distract and to rally people to him.  A war is likely the only way he and his party win the next elections.   I?셫 sure there are republicans who know this but have made a Faustian bargain to hold onto power. In addition it will largely not be their kids in harms way, but the children of the working class.  So they?셪l be able to ignore the bodies.  As for Trump, he doesn?셳 care who has to go down to satisfy his ego.',
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
    'mojodna');
insert into comments values (2, 31, 24, '0',
     'Well, at least there''s one party that behaves diplomatically and knows how to flatter his narcissistic host.  I just hope this isn''t the end of a budding friendship with Trump cancelling the Iran deal and then threatening to return the Statue of Liberty as well.',
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
    'joshknowles');
insert into comments values (2, 38, 25, '0',
     'Bonne Chance, Emmanuel Macron! You are being subjected to the most boorish behavior by Mr.Trump.He fawns over you and acts as though you are his great friend.His behavior is an embarrassment .Mr Macron,we wish you luck in making him hear your concerns and hope that your superior judgment on the Iran treaty and cooperation on climate change will somehow prevail.In the European tradition you take a world view-Mr. Trump has a narrow,United States centric obsession.He forgets our loyal allies who have come to our side many times.',
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
    'bmizerany');
insert into comments values (3, 39, 26, '0',
     'One has to wonder - does Trump have even a basic understanding of the Iran deal? It appears that his main interest in tearing up the deal is based on his hatred of President Obama.',
