insert into comments values (2, 45, 29, '0',
     'In business, Mr. Trump negotiated hard, cut deals, and ultimately, when his projects spectacularly failed, cut his losses, abandoned his partners, stiffed people he owed money too, and used courts and bankruptcy to walk away. He personally come out ahead, while everyone else lost. <br/><br/>One wonders whether he understands what will happen in the Middle East, and world security, if follows the same trajectory in dealing with Iran and their nuclear ambitions.',
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
    'sam');
insert into comments values (3, 42, 30, '0',
     '"All it does is postpone Iran?셲 nuclear program for 10 years, then the deal goes away. Than what? Negotiate a new pact?" .....Where is your brain. If you tear up the deal what are you going to do, negotiate a new pact? Well guess what, whatever your plan is, you can tear up the deal and do it tomorrow, or wait ten years and do exactly the same thing. And if you tear it up tomorrow how are you going to get Russia, China and Europe on board with new sanctions?  Tearing it up would be really really dumb.',
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
    'vanpelt');
insert into comments values (2, 29, 31, '1',
     'But that''s where we were before; Iran had a nuclear weapons program that the world wanted to curtail.  And we came to an agreement.<br/><br/>Trump people always assume that Trump has successfully accomplished something before it is started.  For example, Trump was going to fix healthcare, and look at what we got.  Trump was going to have a responsible spending bill, but it adds over a trillion dollars to the national debt and soaks the middle class and benefits the rich.  Trump was going to pull out of Syria, but that is an unknown.  Trump was going to bring the best people to work in his administration and over a dozen of them have been kicked out.  Trump was going to build an expensive wall with Mexico for which Mexico was going to pay, and now, if there is a wall, we will pay for it.<br/><br/>So what makes you think that any reset negotiation that Trump would have with Iran would have anywhere near an ideal outcome?  Why don''t you wait to see if North Korea gets to keep its nuclea',
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
    'mojodna');
