insert into comments values (2, 25, 38, '0',
     'When they say this to me I point out that I am all for banning humans from driving cars! It''s just a matter of present practicality. Once upon a time we needed to have guns to protect our homesteads and wagon trains from wild animals/brigands and hunt for our food. Now we don''t. In the near future it will be practical to simply let the machines drive us, and then we can ban human driven cars too.',
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
    'rsanheim');
