insert into comments values (2, 29, 45, '1',
     'At the time of Dr. Jackson?셲 address to the press re Donald Trump?셲 health, someone asked me what my impressions of him were.  I said, ??You mean besides the line of coke he did before facing the press???There were many reasons for my remark: the first was that MDs never speak in a trip-hammer fashion as Dr. Jackson did for well over an hour.  And yes, there are lots of reasons for a flannel mouth (he mumbled ?쏧 need water??on minute 14:30 of the YouTube video of that performance, only minutes into his remarks). Print news had facial close-ups of him, and those were very telling of someone under the influence of alcohol and drugs.  Knowing little more about him than his earned titles ruled out most relevant metabolic disorders, most of which take time for absences for recovery or adjustments that would certainly have prevented meeting his academic and professional schedules and so, his achievements.  But for those of us who have worked in the area of chemical use/abuse ??and whose pers',
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
    'tomtt');
